class MojiPicker extends StatefulWidget {
  const MojiPicker({required this.id, required this.dye, required this.shouldAddChildMoji, super.key});

  final String id;
  final Dye dye;
  final bool shouldAddChildMoji;

  @override
  State<MojiPicker> createState() => _MojiPickerState();
}

class _MojiPickerState extends State<MojiPicker> {
  late final TextEditingController _searchController;

  List<String> _filteredCodePoints = hugeIconsMap.keys.toList();

  @override
  void initState() {
    _searchController = TextEditingController();
    super.initState();
  }

  @override
  void dispose() {
    _searchController.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    return Align(
      alignment: Alignment.topCenter,
      child: Column(
        mainAxisSize: MainAxisSize.min,
        children: [
          Container(
            height: 40,
            decoration: BoxDecoration(
              color: U.ultraLightBackground(widget.dye),
              borderRadius: BorderRadius.circular(10),
              border: Border.all(
                width: 2,
                color: widget.dye.medium,
              ),
            ),
            child: Center(
              child: Row(
                children: [
                  Padding(
                    padding: const EdgeInsets.only(left: 10, right: 10),
                    child: HugeIcon(icon: HugeIcons.strokeRoundedSearch02, color: widget.dye.ultraDark),
                  ),
                  Expanded(
                    child: TextField(
                      controller: _searchController,
                      keyboardAppearance: untracked(() => S.darkness.value) ? Brightness.dark : Brightness.light,
                      decoration: InputDecoration.collapsed(
                        hintText: 'Search Moji',
                        hintStyle: TextStyle(
                          color: widget.dye.darker,
                          fontWeight: FontWeight.w500,
                          fontFamily: kDefaultFontFamily,
                          fontFamilyFallback: const [kUnicodeMojiFamily],
                        ),
                      ),
                      style: TextStyle(
                        color: widget.dye.ultraDark,
                        fontWeight: FontWeight.w500,
                        fontFamily: kDefaultFontFamily,
                        fontFamilyFallback: const [kUnicodeMojiFamily],
                      ),
                      cursorColor: widget.dye.extraDark,
                      onChanged: (value) {
                        value = value.toLowerCase();
                        setState(
                          () {
                            _filteredCodePoints = hugeIconsMap.entries
                                .where((entry) => entry.value.any((keyword) => keyword.startsWith(value) || keyword == value))
                                .map(
                                  (entry) => entry.key,
                                )
                                .toList();
                          },
                        );
                      },
                    ),
                  ),
                ],
              ),
            ),
          ),
          const SizedBox(height: 10),
          Expanded(
            child: GridView.builder(
              padding: EdgeInsets.zero,
              gridDelegate: const SliverGridDelegateWithFixedCrossAxisCount(crossAxisCount: 6),
              itemCount: _filteredCodePoints.length,
              itemBuilder: (context, index) {
                final mojiSVG = _filteredCodePoints[index];
                return IconButton(
                  style: ButtonStyle(
                    shape: WidgetStateProperty.all(
                      RoundedRectangleBorder(
                        borderRadius: BorderRadius.circular(10),
                      ),
                    ),
                    overlayColor: WidgetStateProperty.all(widget.dye.light),
                  ),
                  icon: SvgPicture.asset(
                    'assets/hugeicons/$mojiSVG',
                    width: 42,
                    height: 42,
                    colorFilter: ColorFilter.mode(widget.dye.ultraDark, BlendMode.srcIn),
                  ),
                  onPressed: () {
                    HapticFeedback.selectionClick();
                    if (widget.shouldAddChildMoji) {
                      final cfid = U.fid();
                      R.addChildMoji(pid: widget.id, cfid: cfid, svg: mojiSVG);
                    } else {
                      R.updateMoji(widget.id, svg: mojiSVG);
                      S.recalculateMojiTilesAt.set(DateTime.now().millisecondsSinceEpoch);
                    }
                    batch(() {
                      // Refresh the moji bar
                      S.implicitPID.set(untracked(() => S.implicitPID.value), force: true);
                      S.shouldShowMojiPicker.set(false);
                      S.shouldAddChildMoji.set(false);
                    });
                  },
                );
              },
            ),
          ),
        ],
      ),
    );
  }
}

